import React from "react";

function calculateAge(): string {
    const now = Date.now()
    const birthdate = new Date('2003-09-22').getTime()
    const diff = (now - birthdate) / (1000 * 60 * 60 * 24 * 365)
    return diff.toPrecision
}

export function LandingPage(): JSX.Element {
    return (<div className='flex grid grid-cols-2 gap-x-15 mx-auto'>
        <>Hi, I'm Nolan.</>
        <div className='bold'>I'm a {calculateAge()} year-old aspiring Software Engineer.</div>
    </div>)
}
